export const ageUpAsyn = (val) => {
    return { type: 'ADD', payload: val };
}


export const ageUp = (val) => {
    return dispatch => {
        setTimeout()

    }
}


export const ageDown = (val) => {
    return { type: 'SUB', payload: val };
}
